import React from 'react';
import '../../../App.css';
import FGB from './FGB';
import Stage_Foch from './Stage_Foch';
import GATE_AFM from './GATE_AFM';

export default function CV() {
  return ( 
    <>
    <body style={{marginLeft: 30, marginRight: 30}}>
    <div>
                    <h1 className="title">
                        <u>
                            More details about my CV
                        </u>
                    </h1>
                </div>
    <FGB/>
    <Stage_Foch/>
    <GATE_AFM/>
    </body>
  </>
  );
}
